import LogoNuKenzie from "../Logo/logo";
import Button2 from "../Button2/button2";
import "./style.css";
import { useState } from "react";
import Card from "../Card/card";
export default function HomePage({ setLandingPage }) {
  const [transac, setTransac] = useState({});
  const [cards, setCards] = useState([]);
  const [filtering, setfiltering] = useState("Todos");
  function callbackDelete(position) {
    const filtrados = cards.filter((elem, index) => index !== position);
    setCards(filtrados);
  }
  function handleSubmit(event) {
    event.preventDefault();

    setCards((previous) => [...previous, transac]);
  }
  function renderCards(card, index) {
    if (card.type === filtering) {
      return (
        <Card
          key={index}
          description={card.description}
          value={card.value}
          type={card.type}
          callbackDelete={() => {
            callbackDelete();
          }}
        />
      );
    }
    if (filtering === "Todos") {
      return (
        <Card
          key={index}
          description={card.description}
          value={card.value}
          type={card.type}
          callbackDelete={() => {
            callbackDelete();
          }}
        />
      );
    }
    return (
      <main className="home-page">
        <header className="hp-header">
          <div className="hp-container-header">
            <LogoNuKenzie />
            <button
              onClick={() => {
                setLandingPage((previous) => !previous);
              }}
            >
              Inicio
            </button>
          </div>
        </header>
        <div className="hp-page">
          <div className="hp-page-container">
            <div className="form-total ">
              <form onSubmit={handleSubmit}>
                <p>Descrição</p>
                <input
                  className="input-default "
                  placeholder="Digite aqui sua descrição"
                  onChange={(event) =>
                    setTransac({ ...transac, description: event.target.value })
                  }
                  required
                ></input>
                <label className="text3 ">Ex: Compra de roupas</label>
                <div className="container-value">
                  <div className="value">
                    <p>Valor</p>
                    <div className="div-value">
                      <input
                        className="input-default value-input"
                        onChange={(event) =>
                          setTransac({ ...transac, value: event.target.value })
                        }
                        required
                      ></input>
                      <p>R$</p>
                    </div>
                  </div>
                  <div>
                    <p>Descrição</p>
                    <select
                      required
                      className="input-default"
                      onChange={(event) =>
                        setTransac({ ...transac, type: event.target.value })
                      }
                    >
                      <option></option>
                      <option value={"Entrada"}>Entrada</option>
                      <option value={"Despesas"}>Despesa</option>
                    </select>
                  </div>
                </div>
                <Button2 text={"Inserir valor"} />
              </form>
              <div className="total-value">
                <div className="div-total1">
                  <p>Valor total:</p>
                  <p>O valor se refere ao saldo </p>
                </div>
                <div className="div-total2">
                  <p>$sald</p>
                </div>
              </div>
            </div>
            <div className="filters ">
              <div className="nav-filter">
                <p>Resumo Financeiro</p>
                <div className="list1 ">
                  <button
                    onClick={() => {
                      setfiltering("Todos");
                    }}
                  >
                    Todos
                  </button>
                  <button
                    type="button"
                    onClick={() => setfiltering("Entradas")}
                  >
                    Entradas
                  </button>
                  <button
                    type="button"
                    onClick={() => setfiltering("Despesas")}
                  >
                    Despesas
                  </button>
                </div>
              </div>
              <ul className="filters2 ">
                {cards.map((elem, index) => renderCards(elem, index))}
              </ul>
            </div>
          </div>
        </div>
      </main>
    );
  }
}
